import React, { Component } from 'react';
import axios from 'axios';
import './models.css';
import {dataService} from '../services/search'

export default class Models extends Component {
   
    BASEURL = 'https://api.models.com/prosearch/sitesearch19-json.html?mdcsearch='

    
    state = {
        users: [],
        isLoading: true,
        errors: null
      };

      

      getUsers() {
        dataService.getData().subscribe(message => {
          console.log(message.value);
        });
        
        axios
          .get(this.BASEURL+this.props.valueToSearch)
          .then(response =>
            response.data.people.map(user => ({
              slug: `${user.slug}`,
              name: `${user.name}`,
              type: `${user.type}`,
              image: `${user.image}`
            }))
          )
          .then(users => {
            this.setState({
              users,
              isLoading: false
            });
          })
          .catch(error => this.setState({ error, isLoading: false }));
      }
    
      
    
      render() {
        console.log(this.props.valueToSearch)
        const { isLoading, users } = this.state;
        return (
          
            <div class="container">
                      <div class="row">
                        <div class="col">
                   
              {!isLoading ? (
                users.map(user => {
                  const { slug, name, type, image } = user;
                  return (
                    
                            <div class="card user-card">
                                <div class="card-header" key={name}>
                                    <h5>{slug}</h5>
                                </div>
                                <div class="card-block">
                                    <div class="user-image">
                                        <img src={'https://i.mdel.net/i/db/'+image} alt={name} class="img-radius"></img>
                                    </div>
                                    <h6 class="f-w-600 m-t-25 m-b-10">{name}</h6>
                                    <p class="text-muted">Active | Male | Born 23.05.1992</p>
                                    <hr>
                                    </hr>
                                    <p class="text-muted m-t-15">Activity Level: 87%</p>
                                    <ul class="list-unstyled activity-leval">
                                        <li class="active"></li>
                                        <li class="active"></li>
                                        <li class="active"></li>
                                        <li></li>
                                        <li></li>
                                    </ul>
                                    <div class="bg-c-green counter-block m-t-10 p-20">
                                        <div class="row">
                                            <div class="col-4"> 
                                               <i class="fa fa-comment"></i><p>1256</p>
                                            </div>
                                            <div class="col-4"> 
                                               <i class="fa fa-user"></i><p>8562</p>
                                            </div>
                                            <div class="col-4"> 
                                               <i class="fa fa-suitcase"></i><p>189</p></div>
                                            </div>
                                    </div>
                                    <p class="m-t-15 text-muted">Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>
                                    <hr></hr>
                                    <div class="row justify-content-center user-social-link">
                                                 <div class="col-auto"><a href="#!"><i class="fa fa-facebook text-facebook"></i></a></div>
                                                 <div class="col-auto"><a href="#!"><i class="fa fa-twitter text-twitter"></i></a></div>
                                                 <div class="col-auto"><a href="#!"><i class="fa fa-dribbble text-dribbble"></i></a></div>
                                    </div>
                                </div>
                            </div>
                      
                  );
                })
              ) : (
                <p>Loading...</p>
              )}  
                     </div>
                    </div>
                  </div>
        );
      
    }
}
